function pal(c,r,g,b)
    poke(0x3fc0+c*3,r)
    poke(0x3fc1+c*3,g)
    poke(0x3fc2+c*3,b)
end
--from aspext1090 on discord

function pl2(c,i)
    poke(0x3fc0+c*3,res64[i][1])
    poke(0x3fc1+c*3,res64[i][2])
    poke(0x3fc2+c*3,res64[i][3])
end
