function camshake()
 if shakelength >=1 and shakelength <10 then
  cam.x = cam.x+ math.random (2)-1
  cam.y = cam.y + math.random (2)-1
  shakelength = shakelength +1
 else
  shakelength = 0
 end
end

function smolmsg()
 
 if smoltimer==nil then
  smoltimer=300
 elseif smoltimer <=0 then
  smoltimer=-100
 else
  smoltimer = smoltimer-1
 end
 
 --textbox
 
 if smtxt==nil then
  smtxt=print(smoltxt,0,-6)
 else
  smtxt=lerp(smtxt,print(smoltxt,0,-6),0.1)
 end
 
 local xs=5
 local ys=110

 local th=12
 local tw=16+smtxt
 
 --bright, mid, dark, bg
 local b,m,d,bg=6,10,12,11
 
 if gamestate == "driving" then
  b=14
  m=7
  d=15
  bg=1
  
 end
 
 if smoltimer >0 then
	 
	 rect(xs,ys-1,tw,2,b)
	 rect(xs-1,ys,4,th,b)
	 
	 rect(xs+tw-4,ys,5,th,d)
	 rect(xs,ys+th-4,tw,5,d)
	 
	 rect(xs,ys,tw,th,m)
	 
	 --portrait
	 if smolimg==417 then
		 --vina in driving minigame
	  spritebdr(419,xs+1,ys-3,-1,1,0,0,0,0,0)
	  
	  spritebdr(smolimg,xs+2,ys+2,-1,1,1,0,0,0,0)
	  spr(418,xs+2,ys+2,0)
	  
	  spr(419,xs+1,ys-3,0)
		elseif smolimg == 247 then
		 --vina in normal levels
		 spritebdr(298,xs+1,ys-3,-1,1,0,0,0,0,0)
	  
	  spritebdr(smolimg,xs+2,ys+2,-1,1,1,0,0,0,0)
	  spr(319,xs+2,ys+2,0)
	  
	  spr(298,xs+1,ys-3,0)
	 end
	 
	 bpt(smoltxt,xs+14,ys+th/2-3,bg,5,1,false)
 end
end

function messagelogic()
 
 if messages[gloc][1] == "eof" then
  
  inmessage=false
 
 --test to see if we are at the end
 --of the interaction
 elseif messages[gloc][iloc][1] == "eoi" then

		inmessage = false
		--reset interaction location to 
		--point to first message
		iloc = 1
	else
		--jump through text with z
		if btnp(4) or btnp(12) then
		 if r2w<=0 then
		  iloc = iloc+1
			 r1w=rwb
				r2w=rwb
			else
			 r1w=0
				r2w=0
		 end
		end
	end
end
function control()
 --really more of a player centric function
 
 begincontrol = time() 
 
 if p.dead==false 
 and bosswait == false then
	  
	 --shell toss
	 if thumbshredder == true then
	  if not btn(5) and not btn(6) 
	  and not btn(13) and not btn(14)
	  and lastframeb == true then  
	
	   local dir = 1
