function entcheck(x,y,k)
  --floor to 8 before passing in 

	 local t,t2,t3
		local floor = math.floor
	 local repl={138,8,14,104,167,107,30,138}
 
		t =mget(x,k+y-8+(level-1)*34)
	 t2=mget(x+1,k+y-8+(level-1)*34)
		t3=mget(x,k+y-9+(level-1)*34)
		
		--hitbox check 
		if t == 96 then
		 hitstore[x*(k+y-8)]=t3+176
			space = mget(x,k+y-7+(level-1)*34)
		
			mset(x,k+y-9+(level-1)*34,space)
		
		end
		
		
	 if t>=192
		 --entlaunch check
	 and  t ~= 211 
		and t ~= 227 then
		 if t2 < 192 
			and not fget(t2,0) then
			 mset(x,k+y-8+(level-1)*34,t2)
			elseif t2 >=192 
			and not fget(t3,0) 
			and t3<192 then
			 mset(x,k+y-8+(level-1)*34,t3)
			else
	   mset(x,k+y-8+(level-1)*34,repl[world])
			end
			
	 	entmake(floor(x*8)+1,
			        floor(k*8+y*8-64),
											0,0,t,0,0,false,0,0,false)
  end
end


