function rotspr(s,x,y,r,w,h,fx,fy,sw,sh)
    if not w then
        w=1
    end
    if not h then
        h=1
    end
    if not sw then
        sw=8
    end
    if not sh then
        sh=8
    end
    local p={}
    local v=math.sqrt(32)
    for i=0,4 do
        p[i*2+1]=x+4+math.cos((0.375+i/4+(r/math.pi/2))*math.pi*2)*v*w
        p[i*2+2]=y+4+math.sin((0.375+i/4+(r/math.pi/2))*math.pi*2)*v*h
    end
    local x1=s%16*8
    local y1=math.floor(s/16)*8
    local x2=x1+sw
    local y2=y1+sh
    if fx then
        x1=x1+sw
        x2=x2-sw
    end
    if fy then
        y1=y1+sh
        y2=y2-sh
    end
    
    ttri(p[1],p[2],p[3],p[4],p[5],p[6],x1,y2,x1,y1,x2,y1,0,0)
    ttri(p[1],p[2],p[7],p[8],p[5],p[6],x1,y2,x2,y2,x2,y1,0,0)
end

