function bossdmg(id,off)
 if not off then off=0 end
 for k,ent in pairs(ents) do
 	if ents[k].ty == 212 
  and ents[k].bct ~= nil 
   and ents[id].hitct==nil then
   local dist = math.sqrt((ents[id].x-ents[k].x-4)^2+(ents[id].y-off-ents[k].y-4)^2) 
   if dist<15 then	
    local strs={"Ouch!","Pow!","Bang!","Yeowch!"}
    
    createfltxt(ents[k].x-cam.x,ents[k].y-cam.y,
                5,11,strs[math.random(1,4)],20)
			
    ents[id].health = ents[id].health-1
				splat(ents[id].x+4,ents[id].y+4,2,3)
			 
				local vecx=(ents[id].x-ents[k].x-4)
				local vecy=(ents[id].y-ents[id].headoff/2-ents[k].y-4)
				local mag=math.sqrt(vecx^2+vecy^2)
				
				if ents[k].carried == true then
				 p.carry = nil
     ents[k].carried=nil
     ents[k].x=ents[k].x-2*vecx/mag
     ents[k].y=ents[k].y-9
    end
				
				--check if there is land below
				--and prevent squash from 
				--getting stuck in floor
				
				ents[k].vx=-3*vecx/mag
				ents[k].vy=-3*vecy/mag
				
				if solid(ents[k].x+ents[k].vx+4,ents[k].y+ents[k].vy+8) then
				 ents[k].vy=-ents[k].vy/2
					ents[k].vx=ents[k].vx*2
				end
				
				ents[id].hitct=30
				
				sfx(58,-1,15,3)
			end
	 end
	end
end


